import React from 'react';
import '../conversation.css'


function Message(props){
  

   if(!props.user)
  {  return(

        <div class="media media-chat"> <img class="avatar" src="https://img.icons8.com/color/36/000000/administrator-male.png" alt="..."></img>
        <div class="media-body">

            <p>{props.message}</p>
            <p class="meta"><time datetime="2018">{props.time}</time></p>
        </div>
      </div>
   
    )}else{
    return(
        <div class="media media-chat media-chat-reverse">
        <div class="media-body">

            <p>{props.message}</p>
            <p class="meta-time"><time datetime="2018">{props.time}</time></p>
            <p class="meta"><time datetime="2018">{props.time}</time></p>
        </div>
    </div>
    )}

}

export default Message;

